import styled from "styled-components";

const Container = styled.div`
  height: 100px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 auto;
  padding: 0 10%;
  background-color: black;
  color: white;
`;

const Menubar = styled.div`
  height: 50px;
  width: 50px;
`;

export function Navbar() {
  return (
    <>
      <Container>
        <h3>UNTITLED</h3>
        <Line /> {/* 가로선 추가 */}
        <img src={Menubar} width="100%" height="100%" />
      </Container>
    </>
  );
}
